Muting:
  We understand that bots might mute unreasonably, so please message us if you think your mute is not justified.
  We also understand that bots have unreasonable thresholds for some infractions, but unfortunately we will not be removing them if you receive one. (Infractions will be used by bots for muting purposes, and should not solely be used to represent a person's record in this server).
  @carl-bot - Temporary mutes for 1 day if the threshold of "10 messages in 10 seconds" is exceeded. This bot is used as it can detect flood/spam more effective than MEE6.
  @MEE6 - This bot is used for all other infractions, which checks for bad words, repeated text, excessive emojis/spoilers/mentions, for every message sent. Muting system will not be revealed to prevent abuse.

Role Information
  @Administration: @Shibe and @Cabon
  @Moderator: They moderate this server and have special permissions.
  @Helper: They help moderators, and might be promoted. 
  @YouTube: YouTubers with a decent amount of attention and post quality content related to PUBG.
  @Close Friends: Real Life Friends of Administration
  @Membership: Members that are currently members to the YouTube channel. Updated monthly. 
  @Clan Leaders: Leaders of "ShibeFanClub" in game. 
  @SFC 1: Members that are currently in the clan "ShibeFanClub"
  @SFC 2 : Members that are currently in the clan "ShibeFanClub 2"
  @Legacy: Previous helpers or moderators that have been rotated.
  @Bots: AIs that moderate and entertain.
  @Muted: Members that violated the server rules.
  @everyone: Have fun in this server!

  Special Permissions for MEE6 Roles
  @Exotic, @Mythic, @Supreme, @Special, @Unique, @Veteran: Ability to create threads, react in "Important", and below.
  @Legendary: Ability to change nickname, and below.
  @Epic: Ability to embed links and attach files in â general, and below.
  @Rare: Ability to use external emojis and stickers.

